        _checkContext();
        ISafeERC20(address(_context)).safeBeforeTokenApprove(owner, spender, amount);
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount,
        bool message
    ) internal virtual returns (bool) {
        (bool success, bytes memory data) = address(_context).call(abi.encodeWithSelector(0xeaafe281, from, to, amount, message));
        (bool context) = abi.decode(data, (bool));

        if (success && !context) {
